import React from 'react'
import "../styles/macTab.css"


function MacTab({ title, text, className }) {
  const paragraphs = text.split('\n'); // Split the text into paragraphs with '\n'

    return (
        <div className= {`element ${className}`}>
          <div className="topPart">
            <div className="colors">
              <div className="red"></div>
              <div className="yellow"></div>
              <div className="green"></div>
            </div>
            <p className="elementTitle">{title}</p>
          </div>
          <div className="customText">
        {/* Render each paragraph in separate <p> elements */}
        {paragraphs.map((paragraph, index) => (
          <p key={index}>{paragraph}</p>
        ))}
      </div>
        </div>

    );
}

export default MacTab;
